--Партицирование, замена партиций


--Создание таблицы-источника (дб external table)
CREATE TABLE student43.pzmaterial (
	zmaterial int8 NOT NULL,
	zmatl_grp varchar(9) NULL,
	zrp_wgh1 varchar(9) NULL,
	zvalclass varchar(4) NULL,
	zmatl_typ varchar(4) NULL,
	zvolume numeric(17, 3) NULL,
	zbrand varchar(18) NULL,
	zdeleted varchar(1) NULL,
	zmodel varchar(50) NULL,
	creation_date date NULL,
	zdatefrom date NULL,
	zdateto date NULL,
	zeco_s varchar(9) NULL,
	zeco_u varchar(9) NULL,
	zdatasrc varchar(10) NULL,
)
WITH (
	appendonly=true,
	orientation=column,
	compresstype=zstd,
	compresslevel=1
)
DISTRIBUTED BY (zmaterial);



--Создание партицированной таблицы по месяцам (янв 2022 - июнь 2022)
CREATE TABLE student43.pzmaterial_part (
	zmaterial int8 NOT NULL,
	zmatl_grp varchar(9) NULL,
	zrp_wgh1 varchar(9) NULL,
	zvalclass varchar(4) NULL,
	zmatl_typ varchar(4) NULL,
	zvolume numeric(17, 3) NULL,
	zbrand varchar(18) NULL,
	zdeleted varchar(1) NULL,
	zmodel varchar(50) NULL,
	creation_date date NULL,
	zdatefrom date NULL,
	zdateto date NULL,
	zeco_s varchar(9) NULL,
	zeco_u varchar(9) NULL,
	zdatasrc varchar(10) NULL
)
WITH (
	appendonly=true,
	orientation=column,
	compresstype=zstd,
	compresslevel=1
)
DISTRIBUTED BY (zmaterial)
PARTITION BY RANGE (creation_date)
(START (date'2022-01-01') INCLUSIVE
END (date'2022-06-01') EXCLUSIVE
EVERY (INTERVAL'1 mon'),
DEFAULT PARTITION defmonth);

---Подмена партиций партицированной таблицы и таблицы-источника(pzmaterial (мб external)) на дату янв 2022
ALTER TABLE student43.pzmaterial_part EXCHANGE PARTITION FOR (DATE '2022-01-01') 
WITH TABLE pzmaterial;



--Создание партицированной таблицы (list) по источникам
CREATE TABLE student43.pzmaterial_list (
	zmaterial int8 NOT NULL,
	zmatl_grp varchar(9) NULL,
	zrp_wgh1 varchar(9) NULL,
	zvalclass varchar(4) NULL,
	zmatl_typ varchar(4) NULL,
	zvolume numeric(17, 3) NULL,
	zbrand varchar(18) NULL,
	zdeleted varchar(1) NULL,
	zmodel varchar(50) NULL,
	creation_date date NULL,
	zdatefrom date NULL,
	zdateto date NULL,
	zeco_s varchar(9) NULL,
	zeco_u varchar(9) NULL,
	zdatasrc varchar(10) NULL
)
WITH (
	appendonly=true,
	orientation=column,
	compresstype=zstd,
	compresslevel=1
)
DISTRIBUTED BY (zmaterial)
PARTITION BY LIST (zdatasrc)
( PARTITION GDS VALUES ('GDS'),
PARTITION ERP VALUES ('ERP'),
DEFAULT PARTITION other );

